    {
        path: "/signup",
        component: Main
    },
    {
        path: "/",
        component: Login,
        exact: true,
    },
    {
        path: "/main",
        component: Main
    },
    {
        path: "/home",
        component: Home
    },
    {
        path: "/task",
        component: Task
    },
]
const App = () => {
    let router = <Router>
        <div>
            <Switch>
                {routes.map((route, index) => {
                    console.log("route",route)
                    return    <Route
                        key={index}
                        path={route.path}
                        exact={route.exact}
                        component={route.component}
                    />}
                    )}
            </Switch>
        </div>
    </Router>;
    return (
        <>
            {router}
        </>
    );
}

export default App;
